import { Dialog } from "@mui/material";




const dialogstyle={
    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'hidden',
}
const ChatDialog=()=>{

    return(
        <Dialog open={true} PaperProps={{sx: dialogstyle}} hideBackdrop={true}>

        </Dialog>
    )
}
export default ChatDialog;
